create table characters_quests
(
    Id       int auto_increment
        primary key,
    OwnerId  int     not null,
    QuestId  int     not null,
    StepId   int     not null,
    Finished tinyint not null,
    IsNew    tinyint not null
)
    engine = MyISAM
    charset = utf8;

create index OwnerId
    on characters_quests (OwnerId);

